import React from 'react';

import logo180 from '../assets/logo180.png';
import search from '../assets/search.svg';
import community from '../assets/social.svg';
import collections from '../assets/bookmark.svg';

export class Sidebar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="w-20 lg:w-64 h-full bg-red-50 flex flex-col">
                <a href="/">
                        <img src={logo180} alt="logo" 
                            className="
                                mx-auto mb-5 mt-2 py-3
                                w-12 
                                lg:w-32 lg:mb-2 
                                block
                            "
                        />
                </a>
                <div className="flex flex-row content-center justify-center lg:justify-start bg-blue-50 lg:pl-4 py-3">
                    <img src={search} className="w-5"/>
                    <h3 className="hidden lg:block text-2xl ml-6 my-auto font-bold leading-none">Search</h3>
                </div>

                <div className="flex flex-row content-center justify-center lg:justify-start bg-blue-50 lg:pl-4 py-3">
                    <img src={community} className="w-5"/>
                    <h3 className="hidden lg:block text-2xl ml-6 my-auto font-bold leading-none">Community Board</h3>
                </div>

                <div className="flex flex-row content-center justify-center lg:justify-start bg-blue-50 lg:pl-4 py-3">
                    <img src={collections} className="w-5"/>
                    <h3 className="hidden lg:block text-2xl ml-6 my-auto font-bold leading-none">collections</h3>
                </div>


            </div>

        )
    }
}
